import { Navrouter } from "./Arreglos";

function Navxl() {
  return (

<ul  className="md:flex hidden uppercase items-center gap-8">
<nav className="h-10" >
        {Navrouter.map(([title]) => {
         <div className="flex h-12" >
            <a className="text-left md:cursor-pointer">
              {title}
            </a>
          </div>;
        })}
      </nav>
</ul>

  );
}

export default Navxl;
